class Welcome extends Component {

  state = {
  }

  render() {
    return (
        <div>
            <Link style={{ textDecoration: 'none', color: 'black' }} to = '/tiles'>
            <h1 className= "welcome-pop">Welcome to People of Promise</h1>
            </Link>
            <Route 
         path = '/tiles' render = {() => (<Tiles />)}
        />
  </div>
    );
  }
}

export default Welcome;
